import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Observable, catchError, throwError } from 'rxjs';
import { environment } from 'src/environments/environment';
import { CheckProfileStatusResponseModel } from '../_models/CheckProfileStatusResponseModel';


const baseUrl = `${environment.apiUrl}/ProfileStatus/CallWsdlApiAsync`;
//https://localhost:7096/ProfileStatus/CallWsdlApiAsync

const headers = {'appVersion':'1.1',
                 'osversion':'1.7.1',
                 'isAndroid':'true',
                 'Content-Type':'application/json',
                 'Access-Control-Allow-Origin':'*',
                 'Access-Control-Allow-Methods':'POST'}

@Injectable({
  providedIn: 'root'
})
export class ProfileService {

  constructor(private http: HttpClient) { }


  createNewProfile(params: any): Observable<any> {
    return this.http.post<any>(baseUrl,{ headers: headers }, params)
    .pipe(catchError(err => {
      return throwError(err);
    }));
}
}
